[{"location":"","page":"Home","title":"Home","text":"CurrentModule = LogisticBetaDistribution","category":"page"},{"location":"#LogisticBetaDistribution","page":"Home","title":"LogisticBetaDistribution","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for LogisticBetaDistribution.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [LogisticBetaDistribution]","category":"page"},{"location":"#LogisticBetaDistribution.LogisticBeta","page":"Home","title":"LogisticBetaDistribution.LogisticBeta","text":"LogisticBeta(α, β)\n\nDefine the LogisticBeta(α, β, 0, 1)-distribution. \n\nThis standardized case of the LogisticBeta distribution is the same as  log(x/(1-x)) for x ∼ Beta(α, β). The general LogisticBeta(α, β, μ, σ) is obtained by the Distributions.jl location-scale construction: μ + σ*LogisticBeta(α, β)\n\nExamples\n\njulia> dist = LogisticBeta(1/2, 1/2)\njulia> rand(dist, 4)'\n1×4 adjoint(::Vector{Float64}) with eltype Float64:\n 1.00851  0.640297  0.566234  2.16941\njulia> pdf(dist, 1)\njulia> cdf(dist, 1)\njulia> dist_general = 3 + 2*LogisticBeta(1/2, 1/2)\njulia> pdf(dist_general, 1)\n\n\n\n\n\n","category":"type"}]
